\u0412\u043e\u043f\u0440\u043e\u0441 4.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Точечные, например год - г.; дефисные - район - р-н, фабрика - ф-ка;
косолинейные - почтовый ящик - п/я; курсивные - килограмм - кг;
комбинированные - железная дорога - ж.-д.
